import React from 'react';

interface LocationMapProps {
  location: string;
}

const LocationMap: React.FC<LocationMapProps> = ({ location }) => {
  // Encode the location for the URL
  const encodedLocation = encodeURIComponent(location);
  
  return (
    <div className="h-48 w-full rounded-lg overflow-hidden">
      <iframe
        width="100%"
        height="100%"
        frameBorder="0"
        scrolling="no"
        marginHeight={0}
        marginWidth={0}
        src={`https://www.openstreetmap.org/export/embed.html?bbox=8.2275,46.8182,8.2275,46.8182&layer=mapnik&marker=46.8182,8.2275&q=${encodedLocation}`}
      />
    </div>
  );
};

export default LocationMap;
